description:
Veronica Avluv drops by her neighbors home and brings by a bottle of wine to welcome him to the neighborhood. Of course, she's a very welcoming neighbor and gives her new neighbor another little gift once she gets him alone inside his house. She tosses him on the bed as soon as she gets a chance and bangs his brains out. There's definitley no better way to be welCUMed to the neighborhood.

